import React from 'react';

export const NoteForm = ({ note, onNoteChange, todoId }) => {
    return (
        <form className="NoteForm">
          <label htmlFor={`note-${todoId}`}>Note*</label>
          <input
            type="text"
            id={`note-${todoId}`}
            value={note}
            onChange={(e) => onNoteChange(e, todoId)}
            className="note-input"
            placeholder="Fail"
            required
          />
        </form>
      );
    };
